import React, {useEffect, useState} from 'react';

function ClientInfo() {
    useEffect( () => {
        fetchItems();
    }, []);

    const [items, setItems] = useState<any[]>([]);

    const fetchItems = async() => {
        const data = await fetch("http://localhost:4000/BackendData");
        const items = await data.json();
        console.log(data.json)
        setItems(items);
        
    };

    return(
        <>
        <section>
            {
            items.map(item => (
                <div className="container-fluid p-3 w-50">
                    <div className="card-deck">
                        <div className="card">
                            <div className="card-body p-1">
                                <h6 className="card-title">{item.name}</h6>
                                <p className="card-text">{item.email}</p>
                                <p className="card-text"><i>{item.phone}</i></p>
                                <p className="card-text">{item.skill_level}</p>
                                <p className="card-text"><i>{item.gender}</i></p>
                                <br/>
                            </div>
                        </div>
                    </div>
                </div>
            ))
            }
        </section>
</>
    )
}

export default ClientInfo;
